import React from 'react';
import menuUser from './menu-user.module.scss';
import { NavLink } from 'react-router-dom';
import { MdDashboard } from 'react-icons/md';
import { FaRegCalendarAlt } from 'react-icons/fa';
import { MdPeople } from 'react-icons/md';

const MenuUser = () => {
    return (
        <div className={menuUser.Menu}>
            <p className={menuUser.Logo}>
                Queue
            </p>
            <div className={menuUser.User}>
                <p>שלום, דור לוי.</p>
            </div>
            <hr />
            <ul className={menuUser.Items}>
                <NavLink activeClassName={menuUser.Current} exact to='/'>
                    <MdDashboard />
                    <span>בית</span>
                </NavLink>
                <NavLink activeClassName={menuUser.Current} to='/queue'>
                    <FaRegCalendarAlt />
                    <span> יומן תורים</span>
                </NavLink>
                <NavLink activeClassName={menuUser.Current} to='/customers'>
                    <MdPeople />
                    <span>לקוחות</span>
                </NavLink>
                <NavLink activeClassName={menuUser.Current} to='/s'>סטטיסטיקות</NavLink>
                <NavLink activeClassName={menuUser.Current} to='/settings'>הגדרות</NavLink>
            </ul>
        </div>
    )
}

export default MenuUser;
